import sys
from collections import defaultdict

def main():
    n = int(sys.stdin.readline())
    songs = [Song(i, sys.stdin.readline().split()) for i in range(n)]
    songs = sorted(songs, key=lambda s: s.time)
    graph = defaultdict(set)
    for s in songs:
        for i in range(1, len(s.next)):
            graph[s.next[i]].add(s)
    visited = set()
    for s in songs:
        if s in visited:
            continue
        visited.add(s)
        stack = [s]
        while stack:
            s = stack.pop()
            for p in s.prev:
                if p in visited:
                    continue
                visited.add(p)
                stack.append(p)
            for n in s.next:
                if n in visited:
                    continue
                visited.add(n)
                stack.append(n)
    if len(visited) < 9:
        print('fail')
        return
    ans = []
    for s in songs:
        if s in visited:
            ans.append(s.num)
    print(' '.join(map(str, ans)))

