import sys
import math

def dist(a, b):
    return math.sqrt((a[0] - b[0]) ** 2 + (a[1] - b[1]) ** 2)

def angle(a, b):
    return math.atan2(b[1] - a[1], b[0] - a[0])

def parse(s):
    res = []
    for i, line in enumerate(s.splitlines()):
        for j, c in enumerate(line):
            if c == 'X':
                res.append((i, j))
    return res

def avg(l):
    return (sum(x for x, y in l) / len(l), sum(y for x, y in l) / len(l))

def touches(s):
    res = []
    for i, j in s:
        res.append((i, j))
        for di, dj in ((0, 1), (1, 0), (0, -1), (-1, 0)):
            ni, nj = i + di, j + dj
            if 0 <= ni < 15 and 0 <= nj < 30 and (ni, nj) not in s:
                res.append((ni, nj))
    return res

def grip(s):
    return avg(touches(s))

def grip_spread(s):
    return avg((dist(grip(s), p) for p in touches(s)))

def grip_rotation(s):
    return avg((angle(grip(s), p) for p in touches(s)))

def rotate(s):
    return (grip_rotation(s) + math.pi / 2) % (2 * math.pi)

def pan(s):
    return dist(grip(s), grip(s))

def zoom(s):
    return grip_spread(s) - grip_spread(s)

def rotate_dist(s):
    return abs(rotate(s))

def zoom_dist(s):
    return abs(zoom(s))

def classify(s):
    p = pan(s)
    r = rotate_dist(s)
    z = zoom_dist(s)
    if p > r and p > z:
        return 'pan'
    elif r > p and r > z:
        return 'rotate ' + ('clockwise' if rotate(s) > 0 else 'counter-clockwise')
    else:
        return 'zoom ' + ('out' if zoom(s) < 0 else 'in')

def main():
    s = sys.stdin.read()
    s = s.split('  ')
    s = [parse(x) for x in s]
    print(len(s[0]), classify(s[0]))

main()

