from collections import deque
from itertools import product

def bfs(start, end, words):
    q = deque([(start, 0)])
    visited = set([start])
    while q:
        word, dist = q.popleft()
        for i in range(len(word)):
            for c in 'abcdefghijklmnopqrstuvwxyz':
                new_word = word[:i] + c + word[i+1:]
                if new_word == end:
                    return dist + 1
                if new_word in words and new_word not in visited:
                    visited.add(new_word)
                    q.append((new_word, dist + 1))
    return -1

def solve(start, end, words):
    min_dist = bfs(start, end, words)
    if min_dist == -1:
        return '0\n-1'
    ans = '0\n' + str(min_dist)
    for word in words:
        if word == start or word == end:
            continue
        words.remove(word)
        dist = bfs(start, end, words)
        if dist != -1 and dist + 1 < min_dist:
            min_dist = dist + 1
            ans = word + '\n' + str(min_dist)
        words.add(word)
    return ans

