import re
from collections import Counter

def parse(molecule):
    return Counter(re.findall(r'([A-Z][a-z]*)|(\d+)', molecule))

def gcd(a, b):
    while b:
        a, b = b, a % b
    return a

def lcm(a, b):
    return a * b // gcd(a, b)

def solve():
    a, k = input().split()
    b = input().split()
    a = parse(a)
    b = parse(b)
    ans = k
    for k in b:
        if k not in a:
            return 0
        ans = lcm(ans, a[k] // b[k])
    return ans // k

